Contract performance management:
Contractor Performance will be managed by the Superintendent and Senior Contracts Manager in accordance with the contract. Some of the key mechansims are as per the Contract Management Plan described below.
Within 14 days of award, the Contractor must submit a controlled copy of the completed Contract Management Plan prepared for the Contract. The Contract Management Plan is to include:
(a) A description of the Contractor’s management structure for control of the work under the Contract (including details of responsibilities and authorities and a resources program);
(b) The management of staff, subcontractors and suppliers;
(c) Procedures for the induction and training of all personnel covering as a minimum, work processes, safety (including rail safety), community relations and environmental considerations as required;
(d) Reporting, including to the Principal’s Representative;
(e) Quality Management;
(f) An index of the Contractor’s management procedures and proposed Inspection and Test Plans with associated checklists);
(g) Schedules for the submission of all documents and other deliverables; and
(h) A procurement strategy for subcontract works.

