Contract performance management:
Queensland Rail will undertake the following Project management activities:
 The Queensland Rail Project Manager will be the interface with the Corridor Access Unit to
integrate construction activities;
 The Queensland Rail Project Manager will be the interface with Queensland Rail
construction to ensure a collaborative and integrated project delivery;
 Queensland Rail shall review and approve Type Approval submissions of equipment as per
Queensland Rail GSS Type Approval requirement;
 Queensland Rail shall provide source files prior to the start of circuit and data design;
 Queensland Rail will issue all existing vital and non-vital data to the Consultant as required;
 Queensland Rail shall plan and apply for track access according to the Queensland Rail
approved Contractors schedule; and
 Queensland Rail will provide Track Protection officers based on the Contractors tender
return requirements.
